import React, { Component } from 'react';
import {Doughnut} from 'react-chartjs-2';

import ReactVivus from 'react-vivus';
import technology from '../SVG/technology.svg'
import all from '../SVG/ALL.svg'

const data={
  labels: ["JavaScript", "Python", "Ruby"],
  datasets: [
    {
      label: "My Skills",
      backgroundColor: ["rgb(255, 99, 132)","rgb(54, 162, 235)","rgb(255, 205, 86)"],
      borderColor: 'white',
      data: [50, 50, 50],
  }]
}

class Tech extends Component {
  render() {
    return (

        <div style={{"width":"100%","height":"100vh","backgroundColor":"#152239", "textAlign":"center","display":"flex"}}>
        <div >
        <svg width="976px" height="150px" viewBox="0 0 976 150" version="1.1" xmlns="http://www.w3.org/2000/svg">
            <title>Group 2</title>
            <desc>Created with Sketch.</desc>
            <g id="Page-1" stroke="none" stroke-width="1" fill="none" fill-rule="evenodd">
                <g id="RIGHT" transform="translate(-41.000000, -176.000000)" fill="#FFFFFF">
                    <g id="Group">
                        <g id="Group-2" transform="translate(0.000000, 95.000000)">
                            <text id="TECHNOLOGY" stroke="#33466B" font-family="Phosphate-Inline, Phosphate" font-size="165" font-weight="normal">
                                <tspan x="43.6325" y="155.29658">TECHNOLOGY</tspan>
                            </text>
                            <path d="M41,225.771277 L1016,225.771277" id="Path-2" stroke="#FFFFFF" stroke-width="10"></path>
                        </g>
                    </g>
                </g>
            </g>
        </svg>
          </div>
          <div style={{"width":"80%","top":"500","display":"inline,","margin":"auto"}}>
            <ReactVivus
              id="all"
              option={{
                file: all,
              }}
              style={{ height: '100%%', width: '100%'}}
              callback={console.log}
            />
          </div>

        </div>
    )
  }
}

export default Tech;
